import React from 'react';

import BookList from '../book-list/book-list'


const HomePage = () => {

    const  booksArr = [
        {   id:1, 
            title: 'english papa',
            author: 'Susan J'},

        {   id:2, 
            name: 'english mama',
            author: 'Joe Pi'}
    ]

    return (
        <div>
            <BookList books={booksArr}/>
        </div>
    )
}

export default HomePage;
